import React from 'react';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';


import GrainIcon from '@material-ui/icons/Grain';
import GridOnIcon from '@material-ui/icons/GridOn';

const CosutmBottomNavigationAction = withStyles({
    root: {
      color: "#999",
      '&$selected': {
        color: "#00f",
      },
    },
    selected: {},
  })((props) => <BottomNavigationAction color="default" {...props} />);

function BottomBtn() {

    return (
    <BottomNavigation
    value={value}
    onChange={(event, newValue) => {
      setValue(newValue);
    }}        
    showLabels
  >
    <CosutmBottomNavigationAction label="Point" icon={<GrainIcon />} />
    <CosutmBottomNavigationAction label="Hex" icon={<GridOnIcon />} />
  </BottomNavigation>
  )
}

export default BottomBtn;
